description:
Part 4 of the greatest of all Blair Witch Project parodies. This installment is somewhat post-modern, as the story centers around Nikki Fritz and Julie K. Smith playing themselves, traveling into the woods to shoot a promotional video for the Bare Wench Trilogy, along with their naive but trusty assistant, Glori-Anne Gilbert. This movie mainly consists of Nikki and Julie reminiscing about scenes from the previous three Bare Wench films, followed by replayings of the relevant scenes. The important part for us, the viewers, is that these are more explicit versions of the earlier scenes, containing content deemed too racy for Skinemax and the like. In other words: copious amounts of full frontal nudity! There are also some new scenes here, and as the plot unfolds Nikki, Julie and Glori-Anne come to suspect that the Bare Wench may not be just a corny sex parody of a late nineties low-budget horror film. Also, all three of them do nice stripteases and have a lesbian three-way.

